window.bookSummaryJSON = "<p><b>In this rip-roaring space opera, a ragtag band of explorers are out to make the biggest score in the galaxy.</b></p> <p><b>On this space jump, no one is who they seem....</b></p> <p>Captain Hammond Roystan is a simple cargo runner who has stumbled across the find of a lifetime: the <i>Hassim,</i> a disabled exploration ship - and its valuable record of unexplored worlds.</p> <p>His junior engineer, Josune Arriola, said her last assignment was in the uncharted rim. But she is decked out in high-level bioware that belies her humble backstory.</p> <p>A renowned body-modification artist, Nika Rik Terri has run afoul of clients who will not take no for an answer. She has to flee off-world, and she is dragging along a rookie modder, who seems all too experienced in weapons and war....</p> <p>Together this mismatched crew will end up on one ship, hurtling through the lawless reaches of deep space with Roystan at the helm. Trailed by nefarious company men, they will race to find the most famous lost world of all - and riches beyond their wildest dreams....</p>"; 
